import React, {Component} from 'react';
import Link from 'react-router-dom';

class Home extends Component{
	render(){
		return(
			<div>
				<Link to="/branches">Branches</Link>
				<Link to="/items">Items</Link>
			</div>
		)
	}
}

export default Home;
